import './styles.css';

var Posts = () => {
    return(
        <div>
            <br />
            <div className="welcome">
                <h3>رايد حمار<img src="https://img.icons8.com/material-outlined/30/2C9EA4/sparkling.png"/></h3>
            </div>
            <br />
            <h4>المنشورات</h4>
            
        </div>
    );
}

export default Posts;
